import React from "react";

function Register() {
  return (
    <div className="register">
      <h1 className="text-white text-center text-3xl m-8">Register</h1>
      <form>
        <div className="grid grid-cols-1 gap-5 m-15">
          <input type="text" />
          <input type="email" />
          <input type="password" />
          <input type="password" />
          <input type="submit" />
        </div>
      </form>
    </div>
  );
}

export default Register;
